import React, { Component } from "react";


class About extends Component {
  render() {
    return (
      <section class="custom_about">
        <div class="jumbotron jumbotron-fluid">
          <div class="container">
            <h1 class="display-4">고은별개못생김 ㅇㅈ?</h1>
            <p class="lead">ㅇㅈ~~~~</p>
          </div>
        </div>
      </section>
    );
  }
}
export default About;
